import{_ as r,E as e,ag as l,D as o}from"./chunks/framework.lDRhkpKe.js";const u=JSON.parse('{"title":"Dromara 孵化器","description":"","frontmatter":{"layout":"home","footer":true,"title":"Dromara 孵化器"},"headers":[],"relativePath":"faq.md","filePath":"faq.md"}'),i={name:"faq.md"};function t(h,a,d,n,s,m){return o(),e("div",null,a[0]||(a[0]=[l('<h1 id="常见问题解答-faq" tabindex="-1">常见问题解答 (FAQ) <a class="header-anchor" href="#常见问题解答-faq" aria-label="Permalink to &quot;常见问题解答 (FAQ)&quot;">​</a></h1><h3 id="_1-孵化流程" tabindex="-1">1. 孵化流程 <a class="header-anchor" href="#_1-孵化流程" aria-label="Permalink to &quot;1. 孵化流程&quot;">​</a></h3><h4 id="_1-1-项目x必须通过孵化器进入dromara吗" tabindex="-1">1.1 项目X必须通过孵化器进入Dromara吗？ <a class="header-anchor" href="#_1-1-项目x必须通过孵化器进入dromara吗" aria-label="Permalink to &quot;1.1 项目X必须通过孵化器进入Dromara吗？&quot;">​</a></h4><p>是的。从DSF（Dromara Software Foundation）外部引入的代码只能通过孵化器进入DSF。孵化器负责以下工作：</p><ul><li>确认许可证符合要求；</li><li>确保版权许可已到位；</li><li>要求所有初始开发者提交CLA（贡献者许可协议）。</li></ul><p>孵化器还为项目提供学习DSF工作方式的机会，由IPMC成员（导师）指导。</p><h4 id="_1-2-我是项目的导师-觉得自己可以完成所有工作。能否跳过孵化器" tabindex="-1">1.2 我是项目的导师，觉得自己可以完成所有工作。能否跳过孵化器？ <a class="header-anchor" href="#_1-2-我是项目的导师-觉得自己可以完成所有工作。能否跳过孵化器" aria-label="Permalink to &quot;1.2 我是项目的导师，觉得自己可以完成所有工作。能否跳过孵化器？&quot;">​</a></h4><p>不能。孵化是一个正式的流程，旨在确保项目按规定被引入DSF，并为将来的IP问题提供记录。DSF不会允许任何项目跳过这个流程，因为这样可能会破坏监督的有效性。</p><h4 id="_1-3-为什么项目xxx没有提到孵化器-该怎么迁移到dromara的xxx项目下" tabindex="-1">1.3 为什么项目XXX没有提到孵化器？该怎么迁移到Dromara的XXX项目下？ <a class="header-anchor" href="#_1-3-为什么项目xxx没有提到孵化器-该怎么迁移到dromara的xxx项目下" aria-label="Permalink to &quot;1.3 为什么项目XXX没有提到孵化器？该怎么迁移到Dromara的XXX项目下？&quot;">​</a></h4><p>孵化过程的职责划分如下：</p><ol><li>项目进入孵化器需要某个Dromara PMC（包括IPMC）作为发起人；</li><li>一旦IPMC接管，指定的导师将负责监督项目的孵化进度；</li><li>项目需每季度向IPMC提交进展报告，直到毕业为止；</li><li>毕业后，如果是其他PMC发起的项目，它将转交给发起PMC，否则需董事会批准成立独立PMC。</li></ol><p>要迁移到XXX项目，请先请求XXX PMC担任你的项目发起人，随后进入孵化流程。</p><h4 id="_1-4-如果有人提议将他们的代码捐赠给dsf的项目x-该怎么操作" tabindex="-1">1.4 如果有人提议将他们的代码捐赠给DSF的项目X，该怎么操作？ <a class="header-anchor" href="#_1-4-如果有人提议将他们的代码捐赠给dsf的项目x-该怎么操作" aria-label="Permalink to &quot;1.4 如果有人提议将他们的代码捐赠给DSF的项目X，该怎么操作？&quot;">​</a></h4><p>孵化器只有在PMC投票通过接受代码时才会接纳代码：</p><ol><li>相关项目需在公共邮件列表上讨论此提议；</li><li>PMC投票决定是否赞助代码（或相关项目）；</li><li>若同意，PMC应联系孵化器，并按照IP Clearance流程记录捐赠。</li></ol><h4 id="_1-5-捐赠的代码来自dsf外部-是不是完全归我们处置" tabindex="-1">1.5 捐赠的代码来自DSF外部，是不是完全归我们处置？ <a class="header-anchor" href="#_1-5-捐赠的代码来自dsf外部-是不是完全归我们处置" aria-label="Permalink to &quot;1.5 捐赠的代码来自DSF外部，是不是完全归我们处置？&quot;">​</a></h4><p>并非如此。以下几点需注意：</p><ul><li>DSF中没有一个代码库可以独占某种通用技术；</li><li>初始代码库仅仅是“初始”，未来的代码和架构方向由社区决定；</li><li>任何感兴趣的贡献者都可以向DSF代码库贡献代码或提出相关项目。</li></ul><h3 id="_2-参与方式" tabindex="-1">2. 参与方式 <a class="header-anchor" href="#_2-参与方式" aria-label="Permalink to &quot;2. 参与方式&quot;">​</a></h3><h4 id="_2-1-如何更新网站" tabindex="-1">2.1 如何更新网站？ <a class="header-anchor" href="#_2-1-如何更新网站" aria-label="Permalink to &quot;2.1 如何更新网站？&quot;">​</a></h4><p>请参考网站更新指南。如果你不是Incubator项目的提交者，可以通过提交补丁的方式参与。</p><h4 id="_2-2-如何更新项目的孵化状态" tabindex="-1">2.2 如何更新项目的孵化状态？ <a class="header-anchor" href="#_2-2-如何更新项目的孵化状态" aria-label="Permalink to &quot;2.2 如何更新项目的孵化状态？&quot;">​</a></h4><p>查看维护Podlings摘要文件和项目状态页面的相关说明。</p><h4 id="_2-3-为什么不使用问题跟踪系统记录孵化状态" tabindex="-1">2.3 为什么不使用问题跟踪系统记录孵化状态？ <a class="header-anchor" href="#_2-3-为什么不使用问题跟踪系统记录孵化状态" aria-label="Permalink to &quot;2.3 为什么不使用问题跟踪系统记录孵化状态？&quot;">​</a></h4><p>问题跟踪系统无法满足法律归档和认证需求。而版本控制系统（如SVN）提供了身份验证功能，确保录入状态信息的人拥有权限。</p><h4 id="_2-4-如何更新孵化项目的网站" tabindex="-1">2.4 如何更新孵化项目的网站？ <a class="header-anchor" href="#_2-4-如何更新孵化项目的网站" aria-label="Permalink to &quot;2.4 如何更新孵化项目的网站？&quot;">​</a></h4><p>阅读孵化政策，并参考网站指南。</p><h4 id="_2-5-如何为基础设施站点获取karma权限" tabindex="-1">2.5 如何为基础设施站点获取Karma权限？ <a class="header-anchor" href="#_2-5-如何为基础设施站点获取karma权限" aria-label="Permalink to &quot;2.5 如何为基础设施站点获取Karma权限？&quot;">​</a></h4><p>向孵化器的通用邮件列表发送请求。</p><h4 id="_2-6-如何搭建podling网站" tabindex="-1">2.6 如何搭建Podling网站？ <a class="header-anchor" href="#_2-6-如何搭建podling网站" aria-label="Permalink to &quot;2.6 如何搭建Podling网站？&quot;">​</a></h4><p>搭建网站需首先申请Karma权限。</p><h4 id="_2-7-如何为现有dromara提交者授予karma权限" tabindex="-1">2.7 如何为现有Dromara提交者授予Karma权限？ <a class="header-anchor" href="#_2-7-如何为现有dromara提交者授予karma权限" aria-label="Permalink to &quot;2.7 如何为现有Dromara提交者授予Karma权限？&quot;">​</a></h4><p>阅读权限授予指南。</p><h4 id="_2-8-孵化器管理有哪些辅助工具-如何生成和维护这些工具" tabindex="-1">2.8 孵化器管理有哪些辅助工具？如何生成和维护这些工具？ <a class="header-anchor" href="#_2-8-孵化器管理有哪些辅助工具-如何生成和维护这些工具" aria-label="Permalink to &quot;2.8 孵化器管理有哪些辅助工具？如何生成和维护这些工具？&quot;">​</a></h4><p>参阅孵化器管理工具设施。</p><h3 id="_3-基础设施" tabindex="-1">3. 基础设施 <a class="header-anchor" href="#_3-基础设施" aria-label="Permalink to &quot;3. 基础设施&quot;">​</a></h3><h4 id="_3-1-我们的项目如何申请资源" tabindex="-1">3.1 我们的项目如何申请资源？ <a class="header-anchor" href="#_3-1-我们的项目如何申请资源" aria-label="Permalink to &quot;3.1 我们的项目如何申请资源？&quot;">​</a></h4><p>通过项目的开发邮件列表和PPMC协作处理。详细说明请参阅导师指南和基础设施说明。</p><p>此FAQ旨在为参与Dromara孵化器项目提供清晰指导。如果有进一步的问题，请在邮件列表中提出。</p>',39)]))}const p=r(i,[["render",t]]);export{u as __pageData,p as default};
